import React from 'react';
import { useHistory } from 'react-router-dom';

const Navbar = ({ setPreferences }) => {
  const history = useHistory();

  const handleLogout = () => {
    localStorage.removeItem('token');
    history.push('/login');
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand">News Aggregator</div>
      <button onClick={() => setPreferences('')}>General News</button>
      <button onClick={() => setPreferences('technology')}>Tech News</button>
      <button onClick={() => setPreferences('sports')}>Sports News</button>
      <button onClick={handleLogout}>Logout</button>
    </nav>
  );
};

export default Navbar;
